import { render } from '@testing-library/react';

import React from 'react';
import {Link, useHistory} from 'react-router-dom'
import { withRouter } from 'react-router-dom';
import axios from 'axios';
import { RssFeed } from '@material-ui/icons';

class NewP extends React.Component{
    handlechange = (event)=>{
        this.setState({
            [event.target.name]: event.target.value
        })
    }
    render(){
        return(
            <div style={{maxWidth:"550px", margin:"0px auto"}}className="form">
            <form onSubmit={this.handlesubmit}>
            <div className="form-in">
            <h3><u>Log in</u></h3>

            <div className="form-group">
                <label>Email</label>
                <input type="email" className="form-control" name = "email"
                 onChange ={this.handlechange} placeholder="Enter email" />
            </div>

            <div className="form-group">
                <label>Password</label>
                <input name = "password"
                type = "password"
                 value = {this.state.password}
                 onChange ={this.handlechange} className="form-control" placeholder="Enter password" />
            </div>


            <button type="submit" className="btn btn-dark btn-lg btn-block">Sign in</button>

            {this.state.errorMessage &&
            <div>{ this.state.errorMessage } </div>}
            </div>
        </form>
        </div>
        )
    }
}
export default withRouter(NewP)
